pub enum SendError<T> {

    /// An IO error.
    Io(io::Error),

    /// The receiving half of the channel has disconnected.
    Disconnected(T),

    /// Underlying notification queue is full
    NotificationQueueFull,
}

pub enum TrySendError<T> {

    /// An IO error.
    Io(io::Error),

    /// Data could not be sent over the channel because it would require the callee to block.
    Full(T),

    /// The receiving half of the channel has disconnected.
    Disconnected(T),

    /// Underlying notification queue is full
    NotificationQueueFull,
}

pub enum NotificationError<T> {

    /// An IO error.
    Io(io::Error),

    /// Notification could not be sent because the queue is full.
    Full(T),
}

pub enum SchedulerStatus {

    /// Currently executing an entry
    Active,

    /// Waiting for new entries to be scheduled
    Parked,

    /// Waiting to execute entries in the queue at the scheduled intervals
    ParkedTimeout,
}
